lonGrid=wrapTo360(lonGrid);
h = worldmap(latlim,lonlim); %[output:48bd39fa]
setm(h,'MapProjection','eqaconicstd') %[output:48bd39fa]
geoshow(latGrid,lonGrid,A) %[output:48bd39fa]
tmp2 = tmp1; tmp2(isnan(tmp1)) = 0;
tmp3 = tmp2; tmp3(tmp3 > 0) = 1;
e1 = pcolorm(grlats,grlons,tmp2'); shading flat %[output:48bd39fa]
set(e1, 'FaceAlpha', 'flat', 'AlphaData', tmp3','edgecolor','none'); %[output:48bd39fa]
hh=colorbar; hh.Label.String = 'SIC [%]'; clim([0 100]); hh.FontSize = 8; %[output:48bd39fa]
hh.Position(4) = 0.6; hh.Position(2) = 0.25; hh.Position(1) = 0.8; %[output:48bd39fa]
lon1 = stas(stind);
lat1 = iceedge(lon1-(min(stas)-1),beg_day_ind);
for k = 1:length(lon1)
    plotm(lat1(k),lon1(k),'marker','.','markersize',12,'color',[0.99 0.99 0.99]); %[output:48bd39fa]
end
for k = stas
    plotm([50 72],[k k],'k--','color',[0.5 0.5 0.5]) %[output:48bd39fa]
end
for k = 1:length(stind)
    plotm([50 72],[stas(stind(k)) stas(stind(k))],'color',[0.25 0.25 0.25]) %[output:48bd39fa]
end
setm(h,'mlabellocation',5,'plabellocation',5,'grid','off','FontSize',8); %[output:48bd39fa]
mlabelzero22pi; % not obvious, but switches label from degW to degE  %[output:48bd39fa]
colormap(parula); %[output:48bd39fa]
set(gcf,'PaperPositionMode','manual');
set(gcf,'PaperUnits','centimeters');
set(gcf,'PaperPosition',[0 0 18 14]);
set(gca,'fontsize',14); if sav_fig == 1 & deseas == 2; print('-dpng','-r300',[fig_path,'fig1.png']); end %[output:48bd39fa]
