% forward-looking fx. e.g. lead array at Jan 10 is 1, 2, 3 day fx of Jan 10
% initializing Jan 9, 8, 7 rather than being 1, 2, 3, day fx for Jan 10, 11, 12
fx_all_case_r = NaN.*fx_all_case;
for h = 1:365
    for t = 1:10
